import asyncComponent from '../helpers/AsyncFunc';

const routes = [
  {
    path: 'guestPortal',
    component: asyncComponent(() => import('./components/GuestPortal'))
  },
  {
    path: 'guestDetails',
    component: asyncComponent(() => import('./components/GuestDetails'))
  }
];
export default routes;
